import logo from "../../assets/img/fox-sitting.svg";
import classes from './Home.module.css';

function Home() {
    return (
        <div className={`${classes.AppMain}`}>
            <img src={logo} className={`${classes.logo}`} alt="logo"/>
            <p>
                The quick brown fox jumps over the lazy dog.
            </p>
        </div>
    );
}

export default Home;
